	add("grig", "{\"term\":\"grig\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"The word is often used in the phrase \u0026quot;merry as a grig\u0026quot;. The word is of uncertain origin, though various theories have been suggested, such as a corruption of \u0026quot;merry as a cricket\u0026quot; or \u0026quot;merry as a Greek\u0026quot;, as in Shakespeare\u0027s Troilus and Cressida: \u0026quot;Then she\u0027s a merry Greek indeed.\u0026quot; Johnson suggested that the word originally meant \u0026quot;anything below the natural size\u0026quot; (compare Swedish \u0026quot;krik\u0026quot; and Scottish \u0026quot;crick\u0026quot;).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"little creature\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A cricket or grasshopper\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1926\u0027\u0027, Hope Mirrlees, \u0027Lud-in-the-Mist\u0027 (Ch. 5\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The black rooks will fly away, my son, and you\u0027ll come back as brown as a berry, and as merry as a \u0027\u0027grig\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An insect in the family Prophalangopsidae, related to katydid\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Any small eel\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The broad-nosed eel. See glu\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"heath\", \"priority\":8}]}, \"synonyms\":{}}");

