	add("griddle", "{\"term\":\"griddle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027gredile\u0027 or Old french (842-ca. 1400) \u0027gridil\u0027 from Latin {{m|la|crāticulum}}, diminutive of {{m|la|crātis}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A flat plate of metal used for cooking\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1871\u0027\u0027, Louisa May Alcott, \u0027w:Little Little Men\u0027, chapter 5\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Such a clatter as the little spoon made, and such a beating as the batter got, it quite foamed, I assure you; and when Daisy poured some on to the \u0027\u0027griddle\u0027\u0027, it rose like magic into a puffy flapjack that made Demi\u0027s mouth water\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1894\u0027\u0027, Lance Rawson, \u0027s:Australian enquiry book of household and general Australian enquiry book of household and general information\u0027, s:Australian enquiry book of household and general Cookery\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Some people when making scones do not trouble to light the oven but use the frying pan: of course if you have a \u0027\u0027griddle\u0027\u0027 it is better than oven or pan, but very few people possess this useful utensil\", \"priority\":5}]}, \"synonyms\":{}}");

