	add("gridlock", "{\"term\":\"gridlock\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"grid + lock\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A condition of total, interlocking traffic congestion on the streets or highways of a crowded city, in which no one can move because everyone is in someone else\u0027s way\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"On a smaller scale: the situation in which cars enter a traffic signal-controlled intersection too late during the green light cycle, and are unable to clear the intersection (due to congestion in the next block) when the light turns red, thus blocking the cross traffic when it\u0027s their turn to go. Repeated at enough intersections, this phenomenon can lead to citywide gridlock\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Figuratively and by extension, any paralysis of a complex system due to severe congestion, conflict, or deadlock\", \"priority\":3}]}, \"synonyms\":{}}");

	add("grief", "{\"term\":\"grief\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027lang\u003denm\u0027 \u0027lang\u003denm\u0027 from Old french (842-ca. 1400) \u0027lang\u003dfro|grief\u0027 () from Latin \u0027lang\u003dla|gravis\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Suffering, hardship\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Pain of mind arising from misfortune, significant personal loss, misconduct of oneself or others, etc.; sorrow; sadness\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"She was worn out from so much \u0027\u0027grief\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The betrayal caused Jeff \u0027\u0027grief\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Cause or instance of sorrow or pain; that which afflicts or distresses; trial\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Surely, he hath borne our \u0027\u0027griefs\u0027\u0027, and carried our sorrows.\u0027 -Isaiah 53:4\", \"priority\":6}]}, \"synonyms\":{}}");

