	add("griffin", "{\"term\":\"griffin\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027griffon\u0027 from Latin \u0027gryphus\u0027 from Ancient greek (to 1453) \u0027γρύψ\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"File:Cotta Greif thumb|a griffin (1\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A mythical beast having the body of a lion and the wings and head of an eagle\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A large vulture (\u0027Gyps fulvus\u0027) found in the mountainous parts of Southern Europe, North Africa, and Asia Minor, supposed to be the \u0026quot;eagle\u0026quot; of the Bible. The bearded griffin is the lammergeier\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An English early apple\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A person who has just arrived from Europe.\u0026lt;!--Webster 1913--\u0026gt\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1842\u0027\u0027, \u0027The Asiatic journal and monthly register\u0027 (volume 38, page 40\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Tables were laid out in the palace, profusely covered with wines and refreshments, in the European style; old hands and \u0027\u0027griffins\u0027\u0027, fair sex and civilians, seemed all determined to enjoy themselve\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A cadet newly arrived in British India: half English, half Indian.\u0026lt;ref\u0026gt;[http://books.google.com/books?id\u003dpgoPAAAAYAAJ\u0026amp;pg\u003dPA555]\u0026lt;/ref\u0026gt\", \"priority\":8}]}, \"synonyms\":{}}");

