	add("grike", "{\"term\":\"grike\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Origin unknown.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A deep cleft formed in limestone surfaces due to water erosion; providing a unique habitat for plant\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1922\u0027\u0027: He climbed over the sedge and eely oarweeds and sat on a stool of rock, resting his ashplant in a \u0027\u0027grike\u0027\u0027. — James Joyce, \u0027Ulysses\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027: The Crag is a sort of crag-shaped feature of limestone, rich in minerals and seamed with crevasses or ‘\u0027\u0027grikes\u0027\u0027’ as they call them hereabouts. — Kyril Bonfiglioli, \u0027Don\u0027t Point That Thing at Me\u0027 (Penguin 2001, p. 157\", \"priority\":3}]}, \"synonyms\":{}}");

