	add("grille", "{\"term\":\"grille\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027grille\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"rack, vehicle cover, etc\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The house was a big elaborate limestone affair, evidently new. Winter sunshine sparkled on lace-hung casement, on glass marquise, and the burnished bronze foliations of \u0027\u0027grille\u0027\u0027 and door\", \"priority\":2}]}, \"synonyms\":{}}");

