	add("grime", "{\"term\":\"grime\", \"etymology\":{\"influencers\":[{},{}], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"middle dutch (ca. 1050-1350)\", \"English\", \"middle english (1100-1500)\", \"middle low german\", \"old dutch\"], \"text\":\"Middle english (1100-1500) \u0027grim\u0027 (dirt or soot covering the face) from a specialized note of Old english (ca. 450-1100) {{m|ang|grīma||mask}}, from Proto-germanic {{m|gem-pro|*grīmô||mask}}. Possibly influenced by Danish \u0027grim\u0027 (soot, grime) Old dutch \u0027grijmsel\u0027 Middle dutch (ca. 1050-1350) \u0027grime\u0027 Middle low german \u0027greme\u0027 (dirt)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Dirt, grease, soot, etc. that is ingrained and difficult to remove\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"chapter\u003d14|url\u003dhttp://openlibrary.org/works/OL2004261W|passage\u003dNanny Broome was looking up at the outer wall.\u0026amp;nbsp; Just under the ceiling there were three lunette windows, heavily barred and blacked out in the normal way by centuries of \u0027\u0027grime\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A genre of urban music that emerged in London, England, in the early 2000s, primarily a development of UK garage, dancehall, and hip hop\", \"priority\":3}]}, \"synonyms\":{}}");

	add("grimace", "{\"term\":\"grimace\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"French\", \"frankish\", \"middle french (ca. 1400-1600)\", \"old french (842-ca. 1400)\"], \"text\":\"From French \u0027grimace\u0027 from Middle french (ca. 1400-1600) \u0027grimace\u0027 from Old french (842-ca. 1400) \u0027grimace\u0027 \u0027grimuche\u0027 from \u0027grime\u0027 (mask) (with the pejorative suffix {{m|fro|-ace}}, from Latin {{m|la|-āceus}}), from Old Frankish {{m|frk|*grima|*grīma|mask}}, from Proto-germanic {{m|gem-pro|*grīmô||mask, helmet}}, from Proto-indo-european {{m|ine-pro|*gʰer-||to stroke, rub}}. Cognate with Old english (ca. 450-1100) {{m|ang|grīma||mask, visor, helmet, spectre, apparition}}. More at {{l|en|grime}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A distortion of the countenance, whether habitual, from affectation, or momentary and occasional, to express some feeling, as contempt, disapprobation, complacency, etc.; a smirk; a made-up face\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"quot;I trundle off to bed, eyes brimming, face twisted into a grateful glistening \u0027\u0027grimace\u0027\u0027, and awaken the next day wondering what all the fuss was about.\u0026quot; \u0026amp;mdash; \u0027Opera News\u0027, March 2005\", \"priority\":2}]}, \"synonyms\":{}}");

	add("grimalkin", "{\"term\":\"grimalkin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"[Shakespearean] From \u0027grey\u0027 + \u0027malkin\u0027 literally \u0026quot;grey-haired cat\u0026quot; or \u0026quot;grey-haired woman\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A cat, especially an elderly female\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An old, bad-tempered woman; a crone\", \"priority\":2}]}, \"synonyms\":{}}");

